INSERT INTO `pqawv1_target` VALUES (1,0,1,'Fallout 4','https://en.wikipedia.org/wiki/Fallout_4','Uploads/TargetImages/2019/01/16/fallout-4-ps4-screenshots-leaked-19.jpg','Fallout 4 is an action role-playing game set in an open world environment, gameplay is similar to that of Fallout 3 and Fallout: New Vegas, the two previous primary iterations in the series. Returning features include a camera that can switch between a first-person and third-person perspective. Fallout 4 introduces features including a layered armor system, base-building, a dialogue system featuring 111,000 lines of dialogue,[1] a crafting system which implements every lootable object in the game. Enemies such as Mole Rats, Raiders, Super Mutants, Deathclaws, and Feral Ghouls return in Fallout 4, along with the companion Dogmeat.[2]\r\n\r\nThe player has the ability to freely roam in the game\'s world and leave a conversation at any time. If the player has discovered a certain location they may fast-travel to it. They have the ability to customize weapons; the game includes over 50 base guns, which can be crafted with a variety of modifications, such as barrel types and laser focus, with over 700 modifications available. Power Armor has been redesigned to be more like a vehicle than an equipable suit of armor, requiring energy cores and being essentially dead weight without it[3] and can be modified, allowing the player to add items such as a jetpack or selecting separate types of armor for each part of the suit.[4]\r\n\r\nA new feature to the series is the ability to craft and deconstruct settlements and buildings. The player can select many in-game objects and structures, and use them to freely build their own structures. In addition, the towns can be powered with working electricity, using a power line system. Merchants and non-player characters can inhabit the player\'s settlements, for which the player must provide sustenance by growing food in makeshift patches and building water pumps. The player can build various defenses around their settlements, such as turrets and traps, to defend against random attacks.[5]\r\n(from Wikipedia)','2019-01-16 20:29:02.032249','2019-01-16 20:29:02.032249'),(2,1,1,'Angry Birds 2','https://en.wikipedia.org/wiki/Angry_Birds_2','Uploads/TargetImages/2019/01/16/793285-angry-birds-2-android-screenshot-only-chuck-is-left-here-to.jpg','Like the original Angry Birds, players use a slingshot to launch birds at nearby structures; a key difference in Angry Birds 2 is the ability to select birds of desired choice from a deck. This can give the player more freedom by allowing the creation of their own unique strategies. The main enemies of the game are green-colored pigs of varying sizes and abilities to defend, who can be defeated by hitting them with birds or objects.\r\n\r\nIndividual birds and spells are represented on cards. Tapping on a card will select it, placing its contents on the slingshot for launching. Players increase their score by destroying objects and pigs and leveled up birds multiply the score. Birds can be leveled up by gaining feathers of the respective birds. The \"Destruct-o-meter\" fills up during play and if it gets full, a random card will be given to the player. Only three cards can be displayed at a time; the rest appear in the deck. The player begins with five lives and loses one if all cards have been used and at least one pig remains undefeated; once all five lives have been lost, the player must use gems, watch an advertisement or wait (30 minutes for each of the five lives) until the lives are refilled.[3]\r\n(from Wikipedia)','2019-01-16 20:52:37.014613','2019-01-16 20:52:37.014613'),(3,2,1,'Mass Effect: Andromeda','https://en.wikipedia.org/wiki/Mass_Effect:_Andromeda','Uploads/TargetImages/2019/01/17/masseffect_andromeda_ps4pro_1.png','Mass Effect: Andromeda is an action role-playing game in which the player takes control of either Scott or Sara Ryder from a third-person perspective.[1] Both Ryders\' appearances and first names can be determined by the player.[2] The appearance of their father, Alec, is automatically adjusted based on the appearance of the Ryder twins.[3] Upon beating the game, a New Game+ is unlocked, which allows the player to restart the game with certain bonuses and switch to playing as the other Ryder, if desired.[4] Players can also choose to continue playing with their existing character and complete unfinished missions.[5]\r\n\r\nUnlike previous installments in the Mass Effect series, where players begin each new game by choosing from six different character classes that each have their own unique set of skills, players instead have free rein to assign any skills that they want and build towards a specialty over the course of the game.[6] For example, if the player chooses to invest solely in biotic skills, Ryder will unlock the Adept profile, which results in bonuses related to that play style.[7] Experience points are earned by completing missions, and there is no cap on the number of points that can be earned.[8] Once enough points are gained, Ryder levels up, which allows for the unlocking and upgrading of skills along a tree.[9] Points assigned to each skill can be constantly reallocated so that players can experiment with multiple gameplay approaches without having to restart their games and build up their skills from scratch again.[10]\r\n\r\nSimilar to its predecessors, the player can interact with characters in Mass Effect: Andromeda using a radial command menu where the player\'s dialogue options depend on wheel direction.[6] Around the wheel are four types of responses that shape each conversation: emotional, logical, professional, and casual.[11] In general, conversations are based on agreeing or disagreeing with participants.[12] During some conversations, the player is prompted with an \"Impulse Action\" that offers an additional choice to what is available on the dialogue wheel.[13] For example, an on-screen prompt to \"shoot\" might appear and be momentarily selectable.[14] By conversing with non-player characters, Ryder can develop friendships and, in some cases, romantic relationships with them over time.[15] During both dialogue and quest sequences, the player is sometimes tasked with making moral decisions that do not have a clear good/bad distinction but are intended to be more nuanced, marking a departure from the Paragon/Renegade morality system of prior titles in the series.[16]','2019-01-16 21:11:24.532811','2019-01-16 21:11:24.532811'),(4,3,1,'Homeworld 1','https://en.wikipedia.org/wiki/Homeworld','Uploads/TargetImages/2019/01/18/Homeworld1.jpg','Homeworld is a real-time strategy video game for Microsoft Windows. Set in space, the science fiction game follows the Kushan exiles of the planet Kharak after their home planet is destroyed by the Taiidan Empire in retaliation for developing hyperspace jump technology. The survivors journey with their spacecraft-constructing mothership to reclaim their ancient homeworld of Hiigara from the Taiidan, encountering a variety of pirates, mercenaries, traders, and rebels along the way. In each of the game\'s levels, the player gathers resources, builds a fleet, and uses it to destroy enemy ships and accomplish mission objectives. The player\'s fleet carries over between levels, and can travel in a fully three-dimensional space within each level rather than being limited to a two-dimensional plane.','2019-01-18 13:31:57.183163','2019-01-18 13:31:57.183163'),(5,4,1,'Master of Orion II: Battle at Antares','https://en.wikipedia.org/wiki/Master_of_Orion_II:_Battle_at_Antares','Uploads/TargetImages/2019/01/18/Master_of_Orion_2.jpg','Master of Orion II is more complex than the original game, providing more gameplay options for the player. Three new alien races have been added, and there is the option for players to design and add their own race. Instead of the one planet per star system found in the original there are now multiplanet star systems that can be shared with opponents.[4] Spaceships can now engage in combat, marines can board enemy ships, and planets can be blown up. Multiplayer mode includes one-on-one matches and games with up to eight players.[2]\r\n\r\nVictory can be gained by military or diplomatic means. Major elements of the game\'s strategy include the design of custom races and the need to balance the requirements for food, production, cash and research. The user interface provides a central screen for most economic management and other screens that control research, diplomacy, ship movement, combat and warship design.\r\n\r\nConquering the Orion star system does not automatically win the game; it merely provides the powerful Avenger starship and some non-researchable Antaran technologies. There are three routes to victory: conquer all opponents; be elected as the supreme leader of the galaxy; or make a successful assault against the Antaran homeworld. To be elected, a player needs two-thirds of the total votes, and each empire\'s votes are based on the population under its control. (from Wikipedia)','2019-01-18 13:55:03.643049','2019-01-18 13:55:03.643049'),(6,5,1,'World of Tanks','https://en.wikipedia.org/wiki/World_of_Tanks','Uploads/TargetImages/2019/01/18/world_of_tanks.jpg','World of Tanks (WoT) is a massively multiplayer online game, featuring mid-20th century (1930s1960s) era combat vehicles. The player takes control of a single armored vehicle of their choice, and is placed into a battle on a random map. The player has control over the vehicle\'s movement, firing, and can communicate with allied players through typed or voice chat. A simple random match is won either by destroying all vehicles on the opposing team or capturing the opposing team\'s base. There are other game modes that change the rules of the battle, but gameplay mechanics remain the same. World of Tanks contains multiple game mechanics such as camouflage, shell ricochets, and module damage. (from Wikipedia)','2019-01-18 14:05:25.601398','2019-01-18 14:05:25.601398'),(7,6,1,'Hill Climb Racing 2','https://en.wikipedia.org/wiki/Hill_Climb_Racing_(video_game)#Sequel','Uploads/TargetImages/2019/01/18/us-android-3-hill-climb-racing-2.jpg','Hill Climb Racing 2 was released to Android devices on November 28th 2016, to iOS in December 2016 & to Windows 10 on March 23rd 2018. It has since been downloaded over 100 million times on the Google Play store alone & is the all time top grossing racing game for the platform.[4] The sequel introduced several new features including races, structured cups, challenges, special events and multiplayer. It also introduced all new vehicles and tuning parts as well as a large amount of cosmetic player and vehicle customization.','2019-01-18 14:50:10.547263','2019-01-18 14:50:10.547263'),(8,7,1,'Civilization VI','https://en.wikipedia.org/wiki/Civilization_VI','Uploads/TargetImages/2019/01/18/Civilization_VI_screenshot_1.jpg','As with other games in the series, the goal for the player is to lead their fledgling civilization from an early settlement through many millennia to become a world power and achieve one of several victory conditions, such as through military power, technological superiority, or cultural influence, over the other human and computer controlled opponents. Players do this by exploring the world, founding new cities, building city improvements, deploying military troops to attack and defend from others, researching new technologies and cultural civics, and engaging in trade and negotiations with other world leaders.\r\n\r\nA critical design focus was to avoid having the player follow a pre-set path of improvements towards their civilization which they had observed from earlier games. Civilization VI places more emphasis on the terrain by \"unstacking\" city improvements from the main city space and giving bonuses for placing improvements near certain terrains. Other new features include research on the game\'s technology tree based on nearby terrain, a similar technology tree for cultural improvements and a better government civics structure for those playing on a cultural victory path, and new artificial intelligence mechanics for computer-controlled opponents that include secret goals and randomized engagements to disrupt an otherwise stable game.\r\n(from Wikipedia)','2019-01-18 14:54:10.844468','2019-01-18 14:54:10.844468'),(9,8,1,'Grand Theft Auto V','https://en.wikipedia.org/wiki/Grand_Theft_Auto_V','Uploads/TargetImages/2019/01/18/Grand_Theft_Auto_V.jpg','Grand Theft Auto V is an action-adventure game[2] played from either a third-person[3] or first-person perspective.[4][b] Players complete missionslinear scenarios with set objectivesto progress through the story.[5] Outside of the missions, players may freely roam the open world. Composed of the San Andreas open countryside area, including the fictional Blaine County, and the fictional city of Los Santos, the world is much larger in area than earlier entries in the series.[6][c] It may be fully explored after the game\'s beginning without restriction, although story progress unlocks more gameplay content.\r\n\r\nPlayers use melee attacks, firearms and explosives to fight enemies,[d] and may run, jump, swim or use vehicles to navigate the world.[e] To accommodate the map\'s size, the game introduces vehicle types absent in its predecessor Grand Theft Auto IV, such as fixed-wing aircraft.[11] In combat, auto-aim and a cover system may be used as assistance against enemies.[12] Should players take damage, their health meter will gradually regenerate to its halfway point.[f] Players respawn at hospitals when their health depletes.[10] If players commit crimes, law enforcement agencies may respond as indicated by a \"wanted\" meter in the head-up display (HUD).[13] Stars displayed on the meter indicate the current wanted level (for example, at the maximum five-star level, police helicopters and SWAT teams swarm to lethally dispatch players).[14][g] Law enforcement officers will search for players who leave the wanted vicinity. The meter enters a cool-down mode and eventually recedes when players are hidden from the officers\' line of sight that displays on the mini-map.\r\n\r\nThe single-player mode lets players control three characters: Michael De Santa, Trevor Philips and Franklin Clintoncriminals whose stories interconnect as they complete missions. Some missions are completed with only one character and others feature two or three.[18] Outside the missions, players may switch between characters at will by a directional compass on the HUD. The game may switch characters automatically during missions to complete certain objectives. A character\'s compass avatar will flash red if he is in danger and needs help, and flash white if he has a strategic advantage.[19] Though players complete missions as any of the three protagonists, the more difficult heist missions require aid from AI-controlled accomplices with unique skill sets like computer hacking and driving. If an accomplice survives a successful heist, they take a cut from the cash reward[20] and may be available for later missions with improvements to their unique skills.[21] Some heists afford multiple strategies; in a holdup mission, players may either stealthily subdue civilians with an incapacitating agent or conspicuously storm the venue with guns drawn.[22]','2019-01-18 15:01:02.130105','2019-01-18 15:01:02.130105'),(10,9,1,'God of War 2018','https://en.wikipedia.org/wiki/God_of_War_(2018_video_game)','Uploads/TargetImages/2019/01/18/god_of_war_2018.jpg','Unlike previous games, which were loosely based on Greek mythology, this installment is loosely based on Norse mythology, with the majority of it set in ancient Norway in the realm of Midgard. For the first time in the series, there are two protagonists: Kratos, the former Greek God of War who remains as the only playable character, and his young son Atreus; at times, the player may passively control him. Following the death of Kratos\' second wife and Atreus\' mother, they journey to fulfill her promise to spread her ashes at the highest peak of the nine realms. Kratos keeps his troubled past a secret from Atreus, who is unaware of his divine nature. Along their journey, they encounter monsters and gods of the Norse world.','2019-01-18 15:23:09.593773','2019-01-18 15:23:09.593773'),(11,10,1,'Red Dead Redemption 2','https://en.wikipedia.org/wiki/Red_Dead_Redemption_2','Uploads/TargetImages/2019/01/18/Red_Dead_Redemption_2.jpg','Set in 1899 in a fictionalized version of the Western United States, the story centers on outlaw Arthur Morgan, a member of the Van der Linde gang dealing with the decline of the Wild West whilst attempting to survive against government forces, rival gangs, and other opponents. The story also follows fellow gang member John Marston, protagonist from the first Red Dead Redemption.\r\n\r\nRed Dead Redemption 2 is presented through both first and third-person perspectives, and the player may freely roam in its interactive open world. Gameplay elements include shootouts, heists, hunting, horseback riding, interacting with any non-player character (NPC), and maintaining the character\'s honor rating through moral choices and deeds. A bounty system similar to the \"wanted\" system from the Grand Theft Auto franchise governs the response of law enforcement and bounty hunters to crimes committed by the player. Red Dead Online, the online multiplayer mode of the game, was released as a beta version in November 2018.','2019-01-18 16:29:11.584403','2019-01-18 16:29:11.584403'),(12,11,1,'Monster Hunter: World','https://en.wikipedia.org/wiki/Monster_Hunter:_World','Uploads/TargetImages/2019/01/18/monsterhunterworld-9-1-1059531.jpg','In the game, the player takes the role of a Hunter, tasked to hunt down and either kill or trap monsters that roam in one of several environmental spaces. If successful, the player is rewarded through loot consisting of parts from the monster and other elements that are used to craft weapons and armor, amongst other equipment. The game\'s core loop has the player crafting appropriate gear to be able to hunt down more difficult monsters, which in turn provide parts that lead to more powerful gear. Players may hunt alone, or can hunt in cooperative groups of up to four players via the game\'s online services. (from Wikipedia)','2019-01-18 17:19:38.870375','2019-01-18 17:19:38.870375'),(13,12,1,'Heroes of Might and Magic III: The Restoration of Erathia','https://en.wikipedia.org/wiki/Heroes_of_Might_and_Magic_III','Uploads/TargetImages/2019/01/18/Heroes_of_Might_and_Magic_III.jpg','The player can choose to play through seven different campaigns telling the story, or play in a scenario against computer or human opponents.\r\n\r\nThe gameplay is very similar to its predecessors in that the player controls a number of heroes that command an army of creatures inspired by myth and legend. The gameplay is divided into two parts, tactical overland exploration and a turn based combat system. The player creates an army by spending resources at one of the eight town types in the game. The hero will progress in experience by engaging in combat with enemy heroes and monsters. The conditions for victory vary depending on the map, including conquest of all enemies and towns, collection of a certain amount of a resource, or finding the grail artifact.','2019-01-18 18:38:11.277884','2019-01-18 18:38:11.278885'),(14,13,1,'Diablo 1','https://en.wikipedia.org/wiki/Diablo_(video_game)','Uploads/TargetImages/2019/01/18/Diablo_1.png','Set in the fictional Kingdom of Khanduras (located in the mortal realm), Diablo has the player take control of a lone hero battling to rid the world of Diablo, the Lord of Terror. Beneath the town of Tristram, the player journeys through sixteen randomly generated dungeon levels, ultimately entering Hell itself in order to face Diablo.\r\nDiablo is an action role-playing hack and slash video game. The player moves and interacts with the environment primarily by way of a mouse.[8] Other actions, such as casting a spell, are performed in response to keyboard inputs.[8] The player can acquire items, learn spells, defeat enemies, and interact with non-player characters (NPC)s throughout the game.\r\n\r\nThe dungeon levels are randomly generated, although they follow parameters according to their type; for instance the catacombs tend to have long corridors and closed rooms, while the caves are more non-linear. The players are assigned a random number of quests from several tiers; these quests are optional but help to level up the character and/or reveal more of the backstory. The final two quests, however, are mandatory in order to finish the game.','2019-01-18 18:42:34.437646','2019-01-18 18:42:34.437646'),(15,14,1,'Super Smash Bros. Ultimate','https://en.wikipedia.org/wiki/Super_Smash_Bros._Ultimate','Uploads/TargetImages/2019/01/18/Super_Smash_Bros._Ultimate_-_Screenshot_01.png','The game follows the series\' traditional style of gameplay: controlling one of various characters, players must use differing attacks to weaken their opponents and knock them out of an arena. It features a wide variety of game modes, including a campaign for a single-player and multiplayer versus modes. Ultimate includes every playable character from previous Super Smash Bros. gamesranging from Nintendo\'s mascots to characters from third-party franchisesand several newcomers. (from Wikipedia)','2019-01-18 18:59:31.870651','2019-01-18 18:59:31.870651'),(16,15,1,'Celeste','https://en.wikipedia.org/wiki/Celeste_(video_game)','Uploads/TargetImages/2019/01/18/Celeste_-_Screenshot_03.png','Celeste is a platform game in which players control a girl named Madeline as she makes her way up a mountain while avoiding various deadly obstacles. Along with jumping and climbing up walls for a limited amount of time, Madeline has the ability to perform a mid-air dash in the eight cardinal and intercardinal directions. This move can only be performed once and must be replenished by either landing on the ground or hitting certain objects such as replenishing crystals (although the player is granted a second dash later on in the game). Throughout each level, the player will encounter additional mechanics, such as springs that launch the player or feathers that allow brief flight, and deadly objects such as spikes which kill Madeline (returning her to the start of the section). Players can also access an Assist Mode, where they can change some attributes about the game\'s physics. Some of these include: infinite air-dashes, invincibility, or slowing the game\'s speed. Hidden throughout each level are optional strawberries, obtained through challenging platforming or puzzle solving sections, which slightly affect the game\'s ending depending on how many are collected. Additionally, there are cassette tapes which unlock harder \"B-Side\" variations of certain levels, and crystal hearts used to access post-game content. Beating all the B-Sides then unlocks the \"C-Side\" versions, which consists of very hard but short variations upon the levels. Upon clearing all \"C-Sides\", the player can access the Variants menu. The Variants menu allows players to change the game\'s physics in a way similar to the game\'s Assist Mode. Some of these \"variant\" settings include: speeding the game up, 360 degree dashing, and low friction to all flat surfaces. These settings serve to make the game either more challenging or more fun. The original Celeste Classic Pico-8 prototype can also be found as a hidden minigame.\r\n(from Wikipedia)','2019-01-18 20:05:42.913886','2019-01-18 20:05:42.913886'),(17,16,1,'Spider-Man 2018','https://en.wikipedia.org/wiki/Spider-Man_(2018_video_game)','Uploads/TargetImages/2019/01/18/marvels-spider-man-screen-09-ps4-us-30mar18.jpg','Spider-Man is an open world action-adventure game set in the borough of Manhattan in a fictionalised version of modern-day New York City.[1][2] It is presented from a third-person perspective showing the playable character on screen and allowing the camera to be freely rotated around it.[2] The primary playable character is the superhero Spider-Man.[3] Spider-Man can navigate the world by jumping, using his Web Shooters to fire webs to swing between buildings, running along walls, and can automatically run and jump over obstacles. Webs can be precisely aimed to pull himself towards specific points.[2][4] Webs require physical objects to attach to for swinging, and the momentum and speed of the swing can be controlled by releasing the web at specific points to either go faster or higher.[5] The game features an optional fast travel system using the New York City Subway system. (from Wikipedia)','2019-01-18 20:38:43.097025','2019-01-18 20:38:43.097025'),(18,17,1,'Into the Breach','https://en.wikipedia.org/wiki/Into_the_Breach','Uploads/TargetImages/2019/01/19/Into_the_Breach.jpg','Into the Breach is set in the far future where humanity fights against an army of giant monsters collectively called the Vek. To combat them, the player controls soldiers that operate giant mechs that can be equipped with a variety of weapons, armor, and other equipment. The game uses a turn-based combat system, allowing the player to coordinate the actions of their team in response to enemy moves and actions that serve to telegraph their attacks.','2019-01-18 21:34:02.868326','2019-01-18 21:34:02.868326'),(19,18,1,'Assassin\'s Creed Odyssey','https://en.wikipedia.org/wiki/Assassin%27s_Creed_Odyssey','Uploads/TargetImages/2019/01/19/Assassins_Creed_Odyssey.jpg','Assassin\'s Creed Odyssey places more emphasis on role-playing elements than previous games in the series. The game contains dialogue options, branching quests, and multiple endings.[2] The player is able to choose the gender of the main character, adopting the role of Alexios or Kassandra.[3]The game features a notoriety system in which mercenaries chase after the player if they commit crimes like killing or stealing.[4]\r\n\r\nThe player character, Alexios or Kassandra, is a mercenary, and a descendant of the Spartan king Leonidas I. They inherit his broken spear, which is forged into a blade to become a weapon that grants the player special abilities in combat. The game uses a skill tree system that allows the player to unlock new abilities.[5] The three skill trees are \"hunter\", which improves player character\'s archery, \"warrior\", which puts emphasis on combat, and \"assassin\", which focuses on stealth. This replaces the system used in Origins, which granted the player a series of passive abilities.\r\n(from Wikipedia)','2019-01-18 22:07:28.256568','2019-01-18 22:07:28.256568'),(20,19,1,'Return of the Obra Dinn','https://en.wikipedia.org/wiki/Return_of_the_Obra_Dinn','Uploads/TargetImages/2019/01/19/14-return-of-the-obra-dinn-in-game-screenshots_p8j4.jpg','It is a puzzle video game. Return of the Obra Dinn is set aboard a fictional East India Company ghost ship in the early 1800s whose crew and passengers have all mysteriously died or disappeared, with the game\'s objective being to discover how. The player, as an agent of the shipping company assessing what happened, uses a combination of deductive reasoning and the use of a Memento Mortem stopwatch to return to the moment of a crew member\'s death to determine the identity of each of the sixty crew members, how and where they died and, if killed by human hands, the name of their killer. The game, played from the first-person view, uses a 1-bit monochromatic graphical style inspired by games on early Macintosh systems. (from Wikipedia)','2019-01-18 23:12:06.290669','2019-01-18 23:12:06.290669');
